import React from 'react';
import City from './City.js';
import data from '../assets/json/data.js';

class SecondContent extends React.Component {
    constructor() {
        super();
        this.one = null;
        this.two = null;
        this.three = null;
        this.four = null;
    }

    createTable() {
        this.one = this.getRandomCity();
        this.two = this.getRandomCity();
        this.three = this.getRandomCity();
        this.four = this.getRandomCity();

        var list = [];
        list.push(<li key={0}> <City src={this.one.image} name={this.one.name} /> </li>);
        list.push(<li key={1}> <City src={this.two.image} name={this.two.name} /> </li>);
        list.push(<li key={2}> <City src={this.three.image} name={this.three.name} /> </li>);
        list.push(<li key={3}> <City src={this.four.image} name={this.four.name} /> </li>);

        return list;
    }

    getRandomCity() {
        var current = data[Math.floor(Math.random() * data.length)];
        if(!current.used) {
            current.used = true;
            return current;
        } else {
            current = data[Math.floor(Math.random() * data.length)];
            current.used = true;
            return current;
        }
    }

    render() {
        return (
            <div className="container">
                <div id="myCarousel" className="carousel slide" data-ride="carousel">

                <ol className="carousel-indicators">
                    <li data-target="#myCarousel" data-slide-to="0" className="active"></li>
                    <li data-target="#myCarousel" data-slide-to="1"></li>
                    <li data-target="#myCarousel" data-slide-to="2"></li>
                </ol>

                <div className="carousel-inner">
                    <div className="item active">
                    <img src="la.jpg" alt="Los Angeles" style="width:100%;" />
                </div>

                <div className="item">
                    <img src="chicago.jpg" alt="Chicago" style="width:100%;" />
                </div>

                <div className="item">
                    <img src="ny.jpg" alt="New york" style="width:100%;" />
                </div>

                </div>
                    <a className="left carousel-control" href="#myCarousel" data-slide="prev">
                    <span className="glyphicon glyphicon-chevron-left"></span>
                    <span className="sr-only">Previous</span>
                    </a>
                    <a className="right carousel-control" href="#myCarousel" data-slide="next">
                    <span className="glyphicon glyphicon-chevron-right"></span>
                    <span className="sr-only">Next</span>
                    </a>
                </div>
            </div>
        );
    }

    render() {
        return (
            <div className="content2">
                <h5 className="city_header">Popular MYtineraries</h5>
                <ul className="cities">
                    {this.createTable()}
                </ul>
            </div>
        );
    }
}

export default SecondContent;
